  true,\n\t\"url\": null,\n\t\"notes\": \"This dataset was provided to the San Francisco
  Planning Department from the San Francisco County Transportation Authority (Transportation
  Authority) in March 2016. The Transportation Authority uses the San Francisco Chained
  Activity Model Process (SF-CHAMP) to estimate vehicle miles traveled (VMT) by private
  automobiles and taxis for different land use types. Travel behavior in SF-CHAMP
  is calibrated based on observed behavior from the California Household Travel Survey
  2010-2012, Census data regarding automobile ownership rates and county-to-county
  worker flows, and observed vehicle counts and transit boardings. SF-CHAMP uses a
  synthetic population, which is a set of individual actors that represents the Bay
  Areau2019s actual population, who make simulated travel decisions for a complete
  day. rnrnVMT estimates are provided for existing (2012) and future (2040) for three
  land use types: office, residential, and retail. For these estimates, Transportation
  Authority used tour-based analysis for office and residential uses and a trip-based
  analysis for retail uses. The aforementioned VMT estimates are provided for each
  transportation analysis zone within San Francisco and compared to regional averages.rnrnRefer
  to March 3, 2016 San Francisco Planning Commission <a target='_blank' href='http://sf-planning.org/transportation-sustainability-program'>Transportation
  Sustainability Program</a> staff report for further details.rnrnThe data is in a
  zipped file geodatabase (GIS) format.  Geographic boundaries are Traffic Analysis
  Zones (TAZ's).\",\n\t\"license_title\": \"Other License Specified\",\n\t\"extras\":
